import styled from 'styled-components';

const Styled = styled.div`
    .ant-modal {
        height: 90vh;
    }
    .ant-modal-content {
        height: 100% !important;
    }
    input[type='date'] {
        line-height: 20px;
    }

    label {
        font-weight: unset;
        padding-bottom: 2px;
    }
    .ant-modal-body {
        height: 80vh;
        overflow-y: overlay;
        padding-bottom: 70px;
    }
    .btn-action {
        z-index: 99;
        position: absolute;
        bottom: 0;
        width: 100%;
        padding: 10px;
        background: #fff;
        left: 0;
        right: 0;
        display: flex;
        justify-content: center;
        -webkit-box-shadow: 1px 0px 10px 0px rgba(0, 0, 0, 0.1);
        box-shadow: 1px 0px 10px 0px rgba(0, 0, 0, 0.1);
    }
    .btn-form {
        display: flex;
        align-items: flex-end;
    }
    button {
        height: 44px;
        margin: 0 10px;
    }
    .btn-text-info {
        display: flex;
        justify-content: space-between;
        align-item: flex-end;
    }
    .btn-add {
        background-color: #0000ff;
        color: #fff;
        height: 32px;
    }
    .btn-add:hover {
        background-color: #3333ff;
        color: #fff;
    }
    .btn-reset {
        background-color: orange;
        color: #fff;
        height: 32px;
    }
    .btn-reset:hover {
        background-color: #ffb833;
        color: #fff;
    }
    .anticon {
        font-size: 16px;
        padding: 0 3px;
    }
    .ant-col {
        padding: 0 4px;
    }
    .ant-form-item-control-input-content {
        display: flex;
    }
    .ant-table-thead .ant-table-cell {
        background-color: #373e58;
        color: #fff;
    }
`;
export default Styled;
